import React from "react";
import {
  FriendItemStyled,
  IndicatorStyled,
  FotoStyled,
  NameStyled,
} from "./FriendCard.styled";

const FriendCard = ({ friends }) => {
  return (
    <FriendItemStyled key={number}>
      <IndicatorStyled>{isOnline}</IndicatorStyled>
      <FotoStyled src={foto} alt={`foto ${name}`} />
      <NameStyled>{name}</NameStyled>
    </FriendItemStyled>
  );
};

export default FriendCard;
